import axios from "axios";
const customer = {};

customer.create = async (username, password) => {

  const datapost = {
    password: password,
    username: username
  }

  const res = await axios.get("http://localhost:8080/foodpanda/customer",datapost)
  .then(response=>{ return response.data; })
  .catch(error=>{ return error.response; })
  
  return res;
}

export default customer
